import React from "react";

function Navbar() {
  return (
    <nav className="navBar">
      <img
        className="navBar__logo"
        src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fwww.pngitem.com%2Fpimgs%2Fm%2F17-172258_transparent-amazon-logo-black-hd-png-download.png&imgrefurl=https%3A%2F%2Fwww.pngitem.com%2Fmiddle%2FiTRoom_transparent-amazon-logo-black-hd-png-download%2F&tbnid=5h8Gp0UjUzb3rM&vet=12ahUKEwjRzJezhcT4AhXBKbcAHQdJCBUQMygPegUIARDsAQ..i&docid=56-UxZH84rkBLM&w=860&h=232&q=amazon%20logo%20png&ved=2ahUKEwjRzJezhcT4AhXBKbcAHQdJCBUQMygPegUIARDsAQ"
        alt="error"
      />
    </nav>
  );
}

export default Navbar;
